defs.value:
pub enum ContractError {
    Std(StdError),
    OverflowError(OverflowError),
    InsufficientFundsSent {
    },
    ExcessiveWithdraw {
        max_amount: Uint128,
    },
    DescriptionTooShort {
        min_desc_length: u64,
    },
    DescriptionTooLong {
        max_desc_length: u64,
    },
    PollNoStake {
    },
    PollNotExist {
    },
    PollCannotEndInPast {
    },
    PollNotCreator {
        sender: String,
        creator: String,
    },
    PollNotInProgress {
    },
    PoolVotingPeriodNotStarted {
        start_height: u64,
    },
    PollVotingPeriodNotExpired {
        expire_height: u64,
    },
    PollSenderVoted {
    },
    PollInsufficientStake {
    },
    PollQuorumPercentageMismatch {
        quorum_percentage: u8,
    },
}

pub enum ExecuteMsg {
    CastVote {
        poll_id: u64,
        vote: String,
        weight: Uint128,
    },
    StakeVotingTokens {
    },
    WithdrawVotingTokens {
        amount: Option<Uint128>,
    },
    CreatePoll {
        quorum_percentage: Option<u8>,
        description: String,
        start_height: Option<u64>,
        end_height: Option<u64>,
    },
    EndPoll {
        poll_id: u64,
    },
}

pub enum QueryMsg {
    Config {
    },
    TokenStake {
        address: String,
    },
    Poll {
        poll_id: u64,
    },
}
